function create_vue_project {
    echo -e "\033[0;32mCreating a new Vue project...\033[0m"
    npm create vite@latest vue_setup -- --template vue
    mv vue_setup/* .
    rm -rf vue_setup
}

if [ -s "$package_file" ]; then
    npm install 2>/dev/null >/dev/null
else
    create_vue_project
    npm install 2>/dev/null >/dev/null
fi

chmod -R 775 .

# Exibir banner
echo -e "$hex_values"
echo -e "\033[0;31mBy HellFive Osborn\033[0m"
echo

argumento="$@"
args_array=($argumento)
manager="yarn"

# Verificar se o primeiro argumento  "npm" ou "yarn"
if [[ "${args_array[0]}" == "npm" ]]; then
    manager="npm"
    unset 'args_array[0]'
    args_array=("${args_array[@]}")
fi

# Verificar se o primeiro argumento  "dev" e se no h argumentos adicionais
if [ "${args_array[0]}" == "dev" ] && [ "${#args_array[@]}" -eq 1 ]; then
    yarn dev --host --port 5000
else
    bash -c "${manager} ${args_array[*]}"
fi